(93, 'Digital Display Distance Measuring Wheel', 'MT-4.jpg', 1500, 46, 19, '', '<div class=\"zq_center_3_1\">\r\n                <p class=\"zq_zi\">Digital Display Distance Measuring Wheel</p>\r\n                <p>Telescopic aluminum alloy handle, with the length of the lock function, easy to use.</p>\r\n                <p>Electronic digital LCD display, measuring accuracy, clear reading.</p>\r\n                <p>Attached to the stainless steel bracket, it is more convenient to use.</p>\r\n                <p class=\"zq_zi\">Technical Parameters of Digital Display Distance Measuring Wheel</p>\r\n                <table align=\"center\" width=\"475\" cellpadding=\"1\" cellspacing=\"1\" class=\"table2\">\r\n                  <tbody><tr>\r\n                    <td width=\"185\" valign=\"center\"><p align=\"center\">Ref.No</p></td>\r\n                    <td width=\"185\" valign=\"center\"><p align=\"center\">Size</p></td>\r\n                    <td width=\"184\" valign=\"center\"><p align=\"center\">Qty</p></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"185\" valign=\"center\"><p align=\"center\">09511</p></td>\r\n                    <td width=\"185\" valign=\"center\"><p align=\"center\">99999.9m</p></td>\r\n                    <td width=\"184\" valign=\"center\"><p align=\"center\">5</p></td>\r\n                  </tr>\r\n                </tbody></table>\r\n              </div>\r\n'),
