(123, 'Pedal Grease Gun', 'GG-5.jpg', 600, 48, 19, '', '<div class=\"zq_center_3_1\">\r\n                <p class=\"zq_zi\">Pedal Grease Gun</p>\r\n                <p>To ajust up the screw handle, remove the screw and nut, take out the cylinder cover, the pressure plate and cup, then deflated nut screw off, add grease inside the tube body (leave space for pressure plate, spring and cup), then the upper parts assembled according to the in situ tightening, the screw shank backspin, make the pressure spring pressure (not too hard), loosen the deflated nut, pedal a few times, pedal support every step must return to the top, reciprocating again, make the deflated nut oil, fastening, pedal more than two, produce high pressure, lift the gun and pull the trigger, the oil comes.</p>\r\n                <p class=\"zq_zi\">Technical Parameters of Pedal Grease Gun</p>\r\n                <table align=\"center\" width=\"587\" cellpadding=\"1\" cellspacing=\"1\" class=\"table2\">\r\n                  <tbody><tr>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">Ref.No</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">Size</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">QTY/CTN</p></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">09005</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">7L</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">1</p></td>\r\n                  </tr>\r\n                </tbody></table>\r\n              </div>'),
