(150, 'Multi-function Electric Hammer', 'ET-1.jpg', 2500, 55, 19, '', '<div class=\"zq_center_3_1\">\r\n                <p class=\"zq_zi\">Multi-function Electric Hammer</p>\r\n                <p>Flat Drill Function: Fill into the flat drill position, suitable for ceramic tile wall of hardware installed in kitchen, bathroom, and also drill for wood, metal, glasses in DIY processing.</p>\r\n                <p>Electric Hammer Function: Fill into the electric hammer position, suitable for punching on the concrete, mud wall and mixed wall. Great impact and punching powerfully.</p>\r\n                <p>Electric Pick Function: Fill into the electric pick position, suitable for breaking destroy peeling or slotting on the concrete, mud wall and mixed wall.</p>\r\n                <p class=\"zq_zi\">Technical Parameters of Multi-function Electric Hammer:</p>\r\n                <table align=\"center\" width=\"475\" cellpadding=\"1\" cellspacing=\"1\" class=\"table2\">\r\n                  <tbody><tr>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">Ref.No</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">QTY/CTN</p></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">98202</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">4</p></td>\r\n                  </tr>\r\n                </tbody></table>\r\n              </div>'),
(151, 'Dual Function Electric Hammer', 'ET-2.jpg', 2500, 55, 19, '', '<div class=\"zq_center_3_1\">\r\n                <p class=\"zq_zi\">Dual Function Electric Hammer</p>\r\n                <p>With the single-phase series motor as power, having rotating with impact, impact without rotating two functions, Rotating with impact function is suitable for drilling on concrete, rock, masonry and other materials.</p>\r\n                <p>Impact without rotating is suitable for spading on concrete, brick and other materials.</p>\r\n                <p>With speed drilling, and hole drilling high precision, can improve various channels(such as water, electricity, gas)machine tools, equipment and others installation speed and quality and reduce construction cost. It is the ideal tool for all developing construction and installation sectors.</p>\r\n                <p class=\"zq_zi\">Technical Parameters of Dual Function Electric Hammer:</p>\r\n                <table align=\"center\" width=\"587\" cellpadding=\"1\" cellspacing=\"1\" class=\"table2\">\r\n                  <tbody><tr>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">Ref.No</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">Size</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">QTY/CTN</p></td>\r\n                  </tr>\r\n                  <tr>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">98201</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">1200W</p></td>\r\n                    <td width=\"189\" valign=\"center\"><p align=\"center\">4</p></td>\r\n                  </tr>\r\n                </tbody></table>\r\n              </div>'),
